import React from "react";
import styles from "./forrad.module.scss";
import Link from "next/link";

export default function index() {
  return (
    <main className={styles.main}>
      <div className={styles.wrapper}>
        <h1 className={styles.h1}>Hyr Förråd eller Container</h1>

        <select className={styles.select} name="location" id="location">
          <option value="Eskilstuna">Välj Plats</option>
          <option value="Eskilstuna">Eskilstuna</option>
        </select>
        <Link href="/">
          <a className={styles.containerLink}>
            <img src="static/images/container.svg" alt="SB Fastigheter logo" />
          </a>
        </Link>
      </div>
    </main>
  );
}
